import React from "react";

const Home = () => {
    return(
        <>
        <section id="header" className="">
        <div className="container-fluid nav_bg">
        <div className="row">
            <div className="col-10 mx-auto" >
                <div className="col-md-6 pt-5 pt-lg-0"></div>
            </div>
        </div>
        </div>  

        </section>
        </>

    )
}
export default Home;
